	// ==UserScript==
	// @name         New Userscript
	// @namespace    http://4chan.org
	// @version      0.1
	// @description  Paste a post into a crying soyjak image
	// @author       (You)
	// @include      https://*.4chan*.org/*
	// @grant        none
	// ==/UserScript==


	(function () {
	  'use strict';
		
	  const wojak0 = '';
	  const wojak1 = '';
	  
	  const wojaks = [wojak0, wojak1];
	  
	  const quoteColor = '#789922';
	  const bgColor = '#ffffff';
	  
	  window.myLittleGlobal = {};

	  const wrapText = (context, text, x, y, maxWidth, lineHeight) => {
		var words = text.split(' ');
		var line = '';

		for (var n = 0; n < words.length; n++) {
		  var testLine = line + words[n] + ' ';
		  var metrics = context.measureText(testLine);
		  var testWidth = metrics.width;
		  if (testWidth > maxWidth && n > 0) {
			context.font = '48px serif';
			context.fillStyle = quoteColor;

			context.fillText(line, x, y);
			line = words[n] + ' ';
			y += lineHeight;
		  }
		  else {
			line = testLine;
		  }
		}
		context.fillText(line, x, y);
	  }

	  const countLines = (context, text, maxWidth) => {
		let words = text.split(' ');
		let linesN = 0;
		let line = '';

		for (let i = 0; i < words.length; i++) {
		  line += ' ' + words[i];
		  let metrics = context.measureText(line);
		  if (metrics.width > maxWidth) {
			linesN++;
			line = '';
		  }
		}

		return linesN;
	  }

	  const onClick = (box, postText, imgSel) => {
		const image = new Image();
		image.src = `data:image/jpeg;base64, ${wojaks[imgSel]}`

		const canvas = document.createElement('canvas');

		image.onload = () => {
		  canvas.width = image.width;
		  canvas.height = image.height + 100;
		  const ctx = canvas.getContext('2d');

		  ctx.font = '48px serif';
		  let lines = countLines(ctx, postText, image.width);
		  canvas.height = canvas.height + (lines + 2) * 48;

		  ctx.fillStyle = bgColor;
		  ctx.fillRect(0, 0, canvas.width, canvas.height);

		  ctx.font = '48px serif';
		  ctx.fillStyle = quoteColor;
		  wrapText(ctx, postText, 0, image.height + 100, image.width, 48);

		  ctx.imageSmoothingEnabled = false;
		  ctx.drawImage(image, 0, 0);

		  let data = canvas.toDataURL();
		  window.myLittleGlobal.data = data;
		  let imgEl = document.createElement('img');
		  imgEl.src = data;
		  imgEl.style = 'cursor: pointer; ';
		  imgEl.addEventListener("click", ()=>{imgEl.remove();});
		  box.append(imgEl);
		};
	  }
	  
	  const addButan = (box, postText, butanText, imgSel)=> {
		   const button = document.createElement('button');
		  button.textContent = butanText;
		  button.style = 'cursor: pointer; ';
		  button.addEventListener("click", e => {e.preventDefault(), onClick(box, `>${postText}`, imgSel);});
		  box.append(button);
	  }

	  const posts = document.getElementsByClassName('replyContainer');
	  for (let post in posts) {
		  if(!(posts[post]).getElementsByTagName) {
			  continue;
		  }
		const boxWT = posts[post].getElementsByClassName('post reply')[0];
		const box = posts[post].querySelectorAll('.postInfo')[0];
		if (box) {
		  
		  const postText = boxWT.getElementsByTagName('blockquote')[0].innerText;

		  for(let iii in wojaks) {
			 addButan(box,postText,"w "+iii,iii);
		  }
		}
	  }
	  
	  const b64toBlob = (b64Data, contentType='', sliceSize=512) => {
	  const byteCharacters = atob(b64Data);
	  const byteArrays = [];

	  for (let offset = 0; offset < byteCharacters.length; offset += sliceSize) {
		const slice = byteCharacters.slice(offset, offset + sliceSize);

		const byteNumbers = new Array(slice.length);
		for (let i = 0; i < slice.length; i++) {
		  byteNumbers[i] = slice.charCodeAt(i);
		}

		const byteArray = new Uint8Array(byteNumbers);
		byteArrays.push(byteArray);
	  }

	  const blob = new Blob(byteArrays, {type: contentType});
	  return blob;
	};

	const doFileStuff = t =>{
		if(window.myLittleGlobal.data) {
			t.set("upfile", new File([b64toBlob(window.myLittleGlobal.data.substring(22))], "my_image.png"));
			window.myLittleGlobal.data = null;
		}
	};
	  
	  QR.submit = function(e) {
		var t;
		QR.hidePostError(),
		QR.presubmitChecks(e) && (QR.auto = !1,
		QR.xhr = new XMLHttpRequest,
		QR.xhr.open("POST", document.forms.qrPost.action, !0),
		QR.xhr.withCredentials = !0,
		QR.xhr.upload.onprogress = function(e) {
			e.loaded >= e.total ? QR.btn.value = "100%" : QR.btn.value = (0 | e.loaded / e.total * 100) + "%"
		}
		,
		QR.xhr.onerror = function() {
			QR.xhr = null,
			QR.showPostError("Connection error.")
		}
		,
		QR.xhr.onload = function() {
			var e, t, a, i, n, o, r;
			if (QR.xhr = null,
			QR.btn.value = "Post",
			200 == this.status) {
				if (e = this.responseText.match(/"errmsg"[^>]*>(.*?)<\/span/))
					return window.passEnabled && /4chan Pass/.test(e) ? QR.onPassError() : QR.resetCaptcha(),
					void QR.showPostError(e[1]);
				(i = this.responseText.match(/<!-- thread:([0-9]+),no:([0-9]+) -->/)) && (n = i[1],
				o = i[2],
				a = (t = $.id("qrFile")) && t.value,
				QR.setPostTime(),
				Config.persistentQR ? ($.byName("com")[1].value = "",
				(t = $.byName("spoiler")[2]) && (t.checked = !1),
				QR.resetCaptcha(),
				(a || QR.painterData) && QR.resetFile(),
				QR.startCooldown()) : QR.close(),
				Main.tid ? (Config.threadWatcher && ThreadWatcher.setLastRead(o, n),
				QR.lastReplyId = +o,
				Parser.trackedReplies[">>" + o] = 1,
				Parser.saveTrackedReplies(n, Parser.trackedReplies)) : ((r = Parser.getTrackedReplies(Main.board, n) || {})[">>" + o] = 1,
				Parser.saveTrackedReplies(n, r)),
				Parser.touchTrackedReplies(n),
				UA.dispatchEvent("4chanQRPostSuccess", {
					threadId: n,
					postId: o
				})),
				ThreadUpdater.enabled && setTimeout(ThreadUpdater.forceUpdate, 500)
			} else
				QR.showPostError("Error: " + this.status + " " + this.statusText)
		}
		,
		!(t = new FormData(document.forms.qrPost)).entries || !t["delete"] || t.get("upfile") && t.get("upfile").size || t["delete"]("upfile"),
		QR.painterData && (QR.appendPainter(t),
		QR.replayBlob && t.append("oe_replay", QR.replayBlob, "tegaki.tgkr"),
		t.append("oe_time", QR.painterTime),
		QR.painterSrc && t.append("oe_src", QR.painterSrc)),
		clearInterval(QR.pulse),
		QR.btn.value = "Sending",
		doFileStuff(t),
		QR.xhr.send(t))
	}

	})();